import { ArrowIcon } from "./icons/Arrow";

interface IProps {
  title: string
}

export function TableHeaderTitle({ title }: IProps) {
  return (
    <th className={`p-6 ${title === 'ID' ? 'w-1/12' : 'w-2/5'}`} scope="col">
      <div>
        <p>{title}</p>
        <ArrowIcon />
      </div>
    </th>
  );
}
